import React , { Component } from 'react'
import ListData from '../data/clients1.json'

class List extends React.Component {
	render() {
		return(
			<div className="box-content">
				{
					ListData.map((clientsDetail ,clientsInfo ,indexs)=>{
					return(
						<div className="list">
							<div className="list-img">
							</div>
							<div className="list_info">
								<div key="indexs" className="i_name">{clientsDetail.general.firstName} {clientsDetail.general.lastName}</div>
								<div className="i_job">job</div>
								<div className="i_job">position</div>     
							</div>
						</div>
					)
				})}
			</div>
		);
	}
}
export default List
